" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 521px\">",
"   <div class=\"ttl\">",
"    Rotational stretching exercise for congenital muscular torticollis with a tight right sternocleidomastoid muscle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 501px; height: 536px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    With the child in the supine or sitting position, place one hand on the shoulder of the unaffected side (the infant's left side). Use the other hand to gently rotate the infant's chin so that it touches the tip of the shoulder of the affected side (right). This maneuver should be performed without applying pressure to the child&rsquo;s neck with the palm of the hand.",
