"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Removal of cholesteatoma with extension beyond the middle ear",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 274px; height: 480px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    When a cholesteatoma has extended beyond the accessible confines of the middle ear, it is necessary to remove cranial bone to reach the temporal bone spaces above and behind the middle ear. Panel A) The mastoid cortex is removed with a drill. Panel B) The mastoid cortex has been removed to expose a cholesteatoma of the middle ear, attic (pneumatized space just superior to the middle ear), and mastoid. The canal wall is left intact to separate the middle ear and mastoid (a canal-wall-up mastoidectomy).",
"    <div class=\"footnotes\">",
"    </div>",
