var title_f41_36_42570="Preeclampsia light micrograph";
var content_f41_36_42570=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F78879%7ENEPH%2F59970%7ENEPH%2F68634&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F78879%7ENEPH%2F59970%7ENEPH%2F68634&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Preeclampsia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph in preeclampsia showing glomerular endotheliosis. The primary changes are swelling of damaged endothelial cells, leading to partial closure of many of the capillary lumens (large arrows). Mitosis within an endothelial cell (small arrow) is a sign of cellular repair.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a normal glomerulus. There are only 1 or 2 cells per capillary tuft, the capillary lumens are open, the thickness of the glomerular capillary wall (long arrow) is similar to that of the tubular basement membranes (short arrow), and the mesangial cells and mesangial matrix are located in the central or stalk regions of the tuft (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut G Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Preeclampsia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 280px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in preeclampsia showing narrowing of the capillary lumen due to expansion of the mesangium, swelling of the endothelial (Endo) cell cytoplasm (arrow), and subendothelial deposition of hyaline (Hy) material which represents large macromolecules such as IgM. The damaged endothelial cell has become partially separated (*) from the glomerular basement membrane (GBM).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    IgM deposition in preeclampsia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immunofluorescence microscopy in preeclampsia showing diffuse IgM deposition. This represents nonspecific entrapment of larger proteins in the more permeable glomerular capillary wall, rather than the formation of discrete immune complexes. There is, for example, generally no deposition of IgG.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
