var title_f41_36_42572="Fragile X syndrome genotype phenotype correlations";
var content_f41_36_42572=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F73067&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F73067&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Fragile X syndrome genotype-phenotype correlations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Mutation type",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Number of CGG trinucleotide repeats",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Methylation status of FMR1",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Clinical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Male",
"       </td>",
"       <td class=\"subtitle2\">",
"        Female",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Premutation",
"       </td>",
"       <td>",
"        ~59 to ~200",
"       </td>",
"       <td>",
"        Unmethylated",
"       </td>",
"       <td>",
"        At risk for FXTAS*",
"       </td>",
"       <td>",
"        At risk for POF and FXTAS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Full mutation",
"       </td>",
"       <td>",
"        &gt;200",
"       </td>",
"       <td>",
"        Completely methylated",
"       </td>",
"       <td>",
"        100 percent with intellectual disability",
"       </td>",
"       <td>",
"        ~50 percent with intellectual disability, ~50 percent normal intellect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Repeat size mosaicism",
"       </td>",
"       <td>",
"        Varies between premutation and full mutation in different cell lines",
"       </td>",
"       <td>",
"        Partial: unmethylated in the premutation cell line; methylated in the full mutation cell line",
"       </td>",
"       <td>",
"        Nearly 100 percent affected with ID; may be higher functioning",
"        <sup>",
"         &bull;",
"        </sup>",
"        than males with full mutation",
"       </td>",
"       <td>",
"        Highly variable: ranges from normal intellect to affected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Methylation mosaicism",
"       </td>",
"       <td>",
"        &gt;200",
"       </td>",
"       <td>",
"        Partial: mixture of methylated and unmethylated cell lines",
"       </td>",
"       <td>",
"        Nearly 100 percent affected with ID; may be higher functioning",
"        <sup>",
"         &bull;",
"        </sup>",
"        than males with full mutation",
"       </td>",
"       <td>",
"        Highly variable: ranges from normal intellect to affected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unmethylated full mutation",
"       </td>",
"       <td>",
"        &gt;200",
"       </td>",
"       <td>",
"        Unmethylated",
"       </td>",
"       <td>",
"        Nearly all have ID but often have high-functioning ID to low-normal intellect",
"       </td>",
"       <td>",
"        Highly variable: ranges from normal intellect to affected",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     FMR1: fragile X mental retardation 1 gene.",
"     <br>",
"      * Both males and females with premutations and manifestations of some symptoms of fragile X syndrome have been reported",
"      <sup>",
"       [2]",
"      </sup>",
"      .",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       FMR1 mutations are complex alterations involving nonclassic gene-disrupting alterations (trinucleotide repeat expansion) and abnormal gene methylation. This complexity at the gene level affects production of the FMR1 protein and may result in an atypical presentation in which affected individuals occasionally have an IQ above 70, the traditional demarcation denoting mental retardation.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Reproduced with permission from: Saul RA, Tarleton JC. FMR1-Related Disorders (August 2008). In: GeneReviews at GeneTests: Medical Genetics Information Resource (database online). Copyright &copy; University of Washington, Seattle. 1997-2010. Available at: file://www.ncbi.nlm.nih.gov/bookshelf/br.fcgi?book=gene&part;=fragilex (Accessed on December 22, 2009).",
"       </li>",
"       <li>",
"        Riddle JE, Cheema A, Sobesky WE, et al. Phenotypic involvement in females with the FMR1 gene mutation. Am J Ment Retard. 1998; 102:590.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
